import{Navbar,Container} from "react-bootstrap";

function Nav() {
  return (
    <div>


     <Container>
    <Navbar expand="lg" variant="light" bg="light">
      <Navbar.Brand href="#"></Navbar.Brand>
      <a>/Home </a>
      <a>/About</a>
      <a>/favorit</a>
      <input type="text"></input>
    <button>search</button>
  </Navbar>
</Container>



    </div>
  )







}

export default Nav;
